import React from "react";
import s from './Banner.module.css';

const Banner = () => {
    return <div>
        <div className={s.banner}> <h2> Новости </h2></div>
        <div> Узнавайте о событиях и изменениях в системе элекронного обучения</div>
    </div>
}

export default Banner;
